import './App.css';
import NavBar from './Components/NavBar';
import Main from './Components/Main';
import { BookContextProvider } from './Components/Main/BookContext';

function App() {

  return (
    <BookContextProvider>
      <div className="App">
        <NavBar />
        <Main />
      </div>
    </BookContextProvider>
  );

}

export default App;
